// src/components/ConversationList.jsx
import React from 'react';

const dummyUsers = [
  { id: 1, name: 'John Doe', message: 'Hey there!' },
  { id: 2, name: 'Jane Smith', message: 'How’s it going?' },
  { id: 3, name: 'Mike Johnson', message: 'Let’s catch up!' },
];

const ConversationList = ({ onSelect }) => {
  return (
    <div className="sidebar-content">
      {dummyUsers.map((user) => (
        <div
          key={user.id}
          className="single-user-box"
          onClick={() => onSelect(user)}
        >
          <div className="profile-circle">{user.name.charAt(0)}</div>
          <div className="profile-details">
            <h3>{user.name}</h3>
            <p>{user.message}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ConversationList;
